object.script:
numbers = { { "1", 1}, { "2", 2 }, { "3", 3 }, { "4", 4 } }
booleans = {}
for _,v in pairs(numbers) do v[3] = property.getNumber("[CO] "..v[1]) end for _,v in pairs(booleans) do v[3] = property.getNumber("[CO] "..v[1]) end
function onTick()
for _,v in pairs(numbers) do output.setNumber( v[3], input.getNumber(v[2]) ) end for _,v in pairs(booleans) do output.setBool( v[3], input.getBool(v[2]) ) end
end
